import React from 'react'

class LoginForm extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            user: "",
            password: "",
        }

    }


    render() {
        return (
            <div>
                <div>
                    <input type="text" name="LoginName" value={this.state.user}
                        onChange={event => this.setState({ text: event.target.value })}></input>
                </div>

                <div>
                    <input></input>
                </div>
            </div>
        )
    }


}

export default LoginForm
